  const [username, setUsername] = useState();

  return (
    <div className="log-div">
        <div></div>
      <input type="text" placeholder="Enter Username" value="" className="user-name"></input>
      <div className="pass-word"><input type="text" placeholder="Enter Password" value=""></input></div>
      <div className="log-btn"><button onClick={null} > Log In </button></div>

    </div>
  );

};

export default Log;
